@WeichenXu123 thanks, basically, the parsing and planning of the job runs on your local machine. Then, the logical representation of the job is sent to the Spark server running in Databricks for execution in the cluster. That's why you don't actually shouldn't have pyspark installed in the same environment as databricks-connect. I've tried downgrading my (other) pyspark to match the version in the Databricks runtime, but still doesn't work.

@dbczumar I'm just now reading the Databricks Connect documentation (https://docs.databricks.com/dev-tools/databricks-connect.html) and apparently Databricks Runtime 11 is not yet supported:

![image](https://user-images.githubusercontent.com/9136877/187883103-ec4144a0-ec1f-47b6-b599-d7d21bebc7a6.png)

So I don't think I'll be able to try what you propose, since my error occurs specifically only through databricks-connect. Any other ideas? Thank you very much
